import React from 'react';

const Profile = () => {
  return (
    <div className="profile">
      <h2>Your Profile</h2>
      <p>Name: John Doe</p>
      <p>Email: john.doe@example.com</p>
      <h3>Learning Preferences</h3>
      <p>Preferred learning type: Visual</p>
    </div>
  );
};

export default Profile;
